function arrayToHexString(arr) {
  return arr.map(byte => {
    const hex = byte.toString(16).padStart(2, '0');
    return hex;
  }).join('');
}


function hexToUint8Array(hexString) {
  if (hexString.length % 2 !== 0) {
    throw new Error("Invalid hex string length. It should have an even number of characters.");
  }

  const len = hexString.length / 2;
  const uint8Array = new Uint8Array(len);

  for (let i = 0; i < len; i++) {
    const startIndex = i * 2;
    const byteString = hexString.substr(startIndex, 2);
    const byteValue = parseInt(byteString, 16);
    if (isNaN(byteValue)) {
      throw new Error("Invalid hex string. It should only contain hexadecimal characters (0-9, a-f, A-F).");
    }
    uint8Array[i] = byteValue;
  }
  return uint8Array;
}

